DROP TABLE IF EXISTS `companys`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `companys` (
  `ID` varchar(45) NOT NULL COMMENT '主键序列',
  `SHORTNAME` varchar(100) NOT NULL COMMENT '企业简称',
  `FULLNAME` varchar(200) DEFAULT NULL COMMENT '企业全称',
  `DIVISION` varchar(45) DEFAULT NULL COMMENT '分支',
  `CATEGORY` varchar(100) DEFAULT NULL COMMENT '企业所属行业',
  `REPRESENTATIVE` varchar(45) DEFAULT NULL COMMENT '企业法人',
  `LICENSE` varchar(45) DEFAULT NULL COMMENT '企业许可证号',
  `CREATIONDATE` date DEFAULT NULL COMMENT '成立时间',
  `WEBSITE` varchar(100) DEFAULT NULL COMMENT '门户网站',
  `PHONE` varchar(45) DEFAULT NULL COMMENT '联系电话',
  `EMAIL` varchar(45) DEFAULT NULL COMMENT '电子邮件',
  `FAX` varchar(45) DEFAULT NULL COMMENT '传真',
  `POSTALCODE` varchar(45) DEFAULT NULL COMMENT '邮编',
  `CONTACT` varchar(45) DEFAULT NULL COMMENT '联系人',
  `COUNTRY` varchar(45) DEFAULT NULL COMMENT '国家',
  `REGION` varchar(45) DEFAULT NULL COMMENT '省/州',
  `LOCALITY` varchar(45) DEFAULT NULL COMMENT '城市',
  `STREET` varchar(45) DEFAULT NULL COMMENT '街道',
  `DESCRIPTION` varchar(400) DEFAULT NULL COMMENT '备注',
  `STATUS` tinyint(3) unsigned DEFAULT NULL COMMENT '状态0:禁用，1：启用，2：删除',
  `CREATEDBY` varchar(45) DEFAULT NULL COMMENT '创建人',
  `CREATEDDATE` date DEFAULT NULL COMMENT '创建时间',
  `MODIFIEDDATE` date DEFAULT NULL COMMENT '修改时间',
  `MODIFIEDBY` varchar(45) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`ID`),
  KEY `Index_companys_id` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业信息';
/*!40101 SET character_set_client = @saved_cs_client */;

